    [],nt"revision_timestamp": "2015-09-12T07:50:19.338927",nt"name": "annuity-roll-processing-system-arps",nt"isopen":
    true,nt"url": null,nt"notes": "The Annuity Roll Processing System (ARPS)
    contains the vast majority of retirement customer transactions for the U.S. Office
    of Personnel Management (OPM). This includes data from all Federal agencies (Executive,
    Legislative, Judicial branches, U.S. Postal Service, and Intelligence Agencies).
    ARPS is the system of record for all retirements. Monthly annuity payments are made
    through ARPS. We make some aggregated data, such as the number of annuitants added
    to the rolls, publicly available, but most of the data cannot be released because
    it contains personally identifiable information (PII) and information protected
    by the Privacy Act. The Enterprise Human Resources Integration-Statistical Data
    Mart (EHRI-SDM) provides other statistical information on Federal retirements.  However,
    the data is limited to only the Executive branches of the Federal government.",nt"license_title":
